INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1000001, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 2, "2025/01/31 12:00:00", -416.5, 1, 190801, 0.0, 1, "カリン", 62, 3.414, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1000002, "ミッションをクリアして、\n報酬をゲットしましょう！", 2, "2025/01/31 12:00:00", -416.5, 1, 190801, 0.0, 2, "カリン", 62, 3.099, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1000003, "受け取ることができる\n報酬があるようです\n確認してみてください", 2, "2025/01/31 12:00:00", -416.5, 1, 190801, 0.0, 3, "カリン", 63, 2.801, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1000004, "報酬がもらえますよ！\nチェックしてみてください", 2, "2025/01/31 12:00:00", -416.5, 2, 190801, 0.0, 4, "カリン", 63, 0.0, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1000005, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, "2025/01/31 12:00:00", -363.0, 2, 190801, 0.0, 5, "カリン", 64, 2.12, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1000006, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 2, "2025/01/31 12:00:00", -363.0, 1, 190801, 0.0, 6, "カリン", 64, 1.68, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1000007, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, "2025/01/31 12:00:00", -363.0, 2, 190801, 0.0, 7, "カリン", 64, 2.33, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 7, "2025/01/31 12:00:00", -285.0, 3, 133701, -6.0, 101, "ラビリスタ", 61, 5.18, "2030/01/01 14:59:59", 10201);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020102, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 2, "2025/01/31 12:00:00", -285.0, 1, 133901, -2.0, 201, "クリスティーナ", 61, 8.77, "2030/01/01 14:59:59", 10201);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020103, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 1, "2025/01/31 12:00:00", -285.0, 6, 133801, 0.0, 301, "ネネカ", 61, 15.5, "2030/01/01 14:59:59", 10201);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020201, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 5, "2025/02/28 12:00:00", -285.0, 2, 134301, 0.0, 101, "ランファ", 61, 9.061, "2030/01/01 14:59:59", 10202);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 2, "2025/02/28 12:00:00", -285.0, 1, 134401, 0.0, 201, "チカ", 61, 7.699, "2030/01/01 14:59:59", 10202);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020301, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 2, "2025/03/31 12:00:00", -285.0, 1, 134601, 0.0, 101, "アオイ", 61, 8.595, "2030/01/01 14:59:59", 10203);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020302, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 2, "2025/03/31 12:00:00", -285.0, 1, 134501, 0.0, 201, "クローチェ", 61, 7.758, "2030/01/01 14:59:59", 10203);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020401, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 6, "2025/04/30 12:00:00", -285.0, 2, 132302, 0.0, 101, "ルイズマリー", 61, 7.0, "2030/01/01 14:59:59", 10204);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 2, "2025/04/30 12:00:00", -285.0, 1, 132402, 0.0, 201, "イロハ", 61, 7.904, "2030/01/01 14:59:59", 10204);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020403, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 2, "2025/04/30 12:00:00", -285.0, 4, 132502, 0.0, 301, "ソノ", 61, 8.487, "2030/01/01 14:59:59", 10204);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020502, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 2, "2025/05/31 12:00:00", -285.0, 1, 134901, 0.0, 101, "カノン", 61, 8.763, "2030/01/01 14:59:59", 10205);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020503, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 3, "2025/05/31 12:00:00", -285.0, 1, 134801, 0.0, 201, "ツムギ", 61, 6.417, "2030/01/01 14:59:59", 10205);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020601, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 7, "2025/06/30 12:00:00", -285.0, 3, 135001, 0.0, 101, "エリス", 61, 10.335, "2030/01/01 14:59:59", 10206);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020602, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 4, "2025/06/30 12:00:00", -285.0, 2, 135101, 0.0, 201, "シェフィ", 61, 6.281, "2030/01/01 14:59:59", 10206);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020603, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 2, "2025/06/30 12:00:00", -285.0, 1, 135201, 0.0, 301, "プレシア", 61, 12.244, "2030/01/01 14:59:59", 10206);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020701, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 8, "2025/07/31 12:00:00", -285.0, 2, 135301, 0.0, 101, "クリア", 61, 6.339, "2030/01/01 14:59:59", 10207);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020702, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 9, "2025/07/31 12:00:00", -285.0, 7, 135401, 0.0, 201, "アネモネ", 61, 8.184, "2030/01/01 14:59:59", 10207);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020801, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 2, "2025/08/31 12:00:00", -285.0, 9, 129101, 0.0, 101, "アイラ", 61, 3.906, "2030/01/01 14:59:59", 10208);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020802, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 2, "2025/08/31 12:00:00", -285.0, 1, 129201, 0.0, 201, "シナツ", 61, 14.465, "2030/01/01 14:59:59", 10208);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020803, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 3, "2025/08/31 12:00:00", -285.0, 4, 100101, 0.0, 301, "ヒヨリ", 61, 8.662, "2030/01/01 14:59:59", 10208);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020804, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 3, "2025/08/31 12:00:00", -285.0, 1, 100301, 0.0, 401, "レイ", 61, 10.915, "2030/01/01 14:59:59", 10208);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020901, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 7, "2025/09/30 12:00:00", -285.0, 1, 135802, 0.0, 101, "ユキノ", 61, 6.042, "2030/01/01 14:59:59", 10209);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020902, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 1, "2025/09/30 12:00:00", -285.0, 4, 135903, 0.0, 201, "サツキ", 61, 9.402, "2030/01/01 14:59:59", 10209);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1020903, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 1, "2025/09/30 12:00:00", -285.0, 8, 136902, 0.0, 301, "ルルィ", 61, 8.16, "2030/01/01 14:59:59", 10209);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021001, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 2, "2025/10/31 12:00:00", -285.0, 3, 137401, 0.0, 101, "カスミ", 61, 5.0, "2030/01/01 14:59:59", 10210);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021002, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 1, "2025/10/31 12:00:00", -285.0, 4, 136001, 0.0, 201, "アラクネ", 61, 8.12, "2030/01/01 14:59:59", 10210);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021003, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 2, "2025/10/31 12:00:00", -285.0, 4, 136202, 0.0, 301, "ナーナ", 61, 6.386, "2030/01/01 14:59:59", 10210);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021101, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 4, "2025/11/30 12:00:00", -285.0, 3, 136402, 0.0, 101, "ユイ", 61, 7.438, "2030/01/01 14:59:59", 10211);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021102, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 5, "2025/11/30 12:00:00", -285.0, 1, 136302, 0.0, 201, "ミソラ", 61, 8.35, "2030/01/01 14:59:59", 10211);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021201, "新しい年がやってくるね！\nお正月の料理も飾りつけも、\nお姉ちゃんにお任せだよ♪\nみんなで楽しく新年を迎えよう！", 2, "2025/12/31 12:00:00", -285.0, 1, 136501, 0.0, 101, "シズル", 61, 5.0, "2030/01/01 14:59:59", 10212);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021202, "おうちの掃除もトラブルも、 \n世界を揺るがす大ピンチも！\n今年のことは今年のうちに \nサッサと片付けちゃいますっ！", 2, "2025/12/31 12:00:00", -285.0, 1, 137902, 0.0, 201, "リノ", 61, 5.25, "2030/01/01 14:59:59", 10212);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021203, "年の瀬はギルドマスターも\nつい駆け回っちゃう忙しい時期だ！\n一年いろいろあったけど\nお互いイイ年を迎えよう、少年！", 2, "2025/12/31 12:00:00", -285.0, 1, 106801, 0.0, 301, "ラビリスタ", 61, 7.5, "2030/01/01 14:59:59", 10212);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021301, "漂う異国の料理の香り…それだけで\n世界中を旅した気分に浸れますね\nふふ、ほらクローチェ\nあまりはしゃぎすぎないように…♪", 2, "2026/01/31 12:00:00", -285.0, 1, 126501, 0.0, 101, "ライラエル", 61, 8.204, "2030/01/01 14:59:59", 10213);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021302, "異界の姫君と煮炊きにて競い合う…\n感奮興起、いとをかし\n華やかなる祭典と相成るよう、一肌\n脱がせていただきとう存じまする", 2, "2026/01/31 12:00:00", -285.0, 1, 129701, 0.0, 201, "ネフィ＝ネラ", 61, 7.176, "2030/01/01 14:59:59", 10213);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021303, "『ビストロプリンセス』のために\n料理の特訓を重ねてまいりました\nこの料理で騎士様の…い、いえ\n皆様の心とお腹を満たしますわ！", 5, "2026/01/31 12:00:00", -285.0, 1, 133101, 0.0, 301, "ヴァイオレット", 61, 8.602, "2030/01/01 14:59:59", 10213);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021304, "多様な味わいが織りなすハーモニー\nそれこそが我が国の矜持です\nもしもそれを乱すようであれば\nわたしも優しくはありませんよ？", 3, "2026/02/06 12:00:00", -285.0, 1, 138101, 0.0, 102, "ライラエル", 61, 10.14, "2030/01/01 14:59:59", 10213);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021305, "煉獄の穢土にてひと際輝く民草の心\n此れを守護りまするがわっちの責務\n如何な困難待ち受けようと\n不退転の矜持に揺らぎはありんせん", 7, "2026/02/06 12:00:00", -285.0, 1, 138201, 0.0, 202, "ネフィ＝ネラ", 61, 10.152, "2030/01/01 14:59:59", 10213);
INSERT INTO `v1_a0dde6d08116f9322806a5bb986b23b3d14f0c581e0da3872c6d7166d052b5b3` VALUES (1021306, "裏世界の皆様は危機を脱し、\n残るはランドソルの皆様のみ…\n彼らを救い出すために、どうか…\nお立ち下さいペコリーヌ姫…！", 3, "2026/02/06 12:00:00", -285.0, 4, 138001, 0.0, 302, "ヴァイオレット", 61, 9.688, "2030/01/01 14:59:59", 10213);
